"original": |2-
     The names assigned to enumerateds do not need to be unique.  The
     numerical value can describe a range over which the same name
     applies.  The value includes the minimum and maximum inclusive values
     in that range, separated by two period characters.  This is
     principally useful for reserving regions of the space.
"fixed": |-
  The names assigned to enumerateds do not need to be unique.  The numerical value can describe a range over which the same name applies.  The value includes the minimum and maximum inclusive values in that range, separated by two period characters.  This is principally useful for reserving regions of the space.
"ko": |-
  열거된 항목에 할당된 이름은 고유할 필요가 없습니다. 숫자 값은 동일한 이름이 적용되는 범위를 설명할 수 있습니다. 값에는 두 개의 마침표 문자로 구분된 해당 범위의 최소 및 최대 포함 값이 포함됩니다. 이는 주로 공간 영역을 예약하는 데 유용합니다.
